import React from 'react';
import dropDownIcon from '../../assets/caret-down.svg';
const DropdownShop = () => {
  return (
    <div className="collapse navbar-collapse" id="navbarNavDarkDropdown">
      <ul className="navbar-nav">
        <li className="nav-item dropdown">
          <label
            className="btn btn-dark dropdown-toggle"
            data-bs-toggle="dropdown"
            aria-expanded="false"
          >
           Shop
           <img src={dropDownIcon}width={40} height={20.89}/>
          </label>
          <ul className="dropdown-menu dropdown-menu-dark">
            <li>
              <a className="dropdown-item" href="https://shoppuppyculture.com/collections/all">
                All
              </a>
            </li>
            <li>
              <a className="dropdown-item" href="https://shoppuppyculture.com/collections/buy-dvds">
                Another action
              </a>
            </li>
            <li>
              <a className="dropdown-item" href="#">
                Something else here
              </a>
            </li>
          </ul>
        </li>
      </ul>
    </div>
  );
};

export default DropdownShop;



